import React from 'react';
import "../Asserts/Css/ComponentsCss/topbanner.css";
import Studyabroadintakes from "../Asserts/images/Studyabroadintakes.png";

const StudyAbroadIntakes = () =>{
    return  (
           <div className='studyabroadcomponent'>
               <img className='studyabroadimg' src={Studyabroadintakes} width="320px" height="600"></img>
               <h1 className='intakes'>Study abroad intakes</h1>
               
           </div>

    )}
    
    export default StudyAbroadIntakes;
